import { Link } from 'react-router-dom';

export const MyPage = () => {
    return (
        <div>

        <div>
        <Link to=" /home">
        <button>
        <BackIcon />
        </button>
        </Link>
        </div>

          <div className='font-lobster text-center text-blue-900 text-4xl py-32'>My Page</div>

